import ReactDOM from 'react-dom';

import '../../styles/errors/_errors.scss';

export class PageNotFoundError extends React.Component {
    render() {
        return (
            <div className='color'>
                <div className='error-text'>
                    <h1 className='size'>404</h1>
                    <h2>Aïe ! Page non trouvée</h2>
                    <p>La page que vous recherchez n’a pu être trouvée</p>
                </div>
            </div>
        )
    }
}

export default PageNotFoundError
